script: |
  super -f text -I q9545.spq | sort > q9545.out

inputs:
  - name: q9545.spq
    data: |
      SELECT + col0 * - - col2 + ( + col2 ) + - col0 + - 28 + - 37 FROM tab2 (FORMAT parquet) WHERE NOT - - 46 + - CAST ( + col1 AS REAL ) + col1 + - + 56 + + - 9 BETWEEN NULL AND col2;
  - name: tab2

outputs:
  - name: q9545.out
    data: |
